import {Switch, BrowserRouter as Router, Route, Redirect} from "react-router-dom/cjs/react-router-dom.min";
import "./App.scss";
import Home from "./pages/home/Home";
import Watch from "./pages/watch/Watch";
import Register from "./pages/register/Register";
import Login from "./pages/login/Login";

const App = () => {
    const {user} = false;
    return (
        <Router>
            <Switch>
                <Route exact path="/">
                    {user ? <Home /> : <Redirect to="/register" />}
                </Route>
                <Route exact path="/register">
                    <Register />
                </Route>
                <Route exact path="/login">
                    <Login />
                </Route>
                <Route path="/movies">
                    <Home type="movies" />
                </Route>
                <Route path="/series">
                    <Home type="series" />
                </Route>
                <Route path="/watch">
                    <Watch />
                </Route>
            </Switch>
        </Router>
    );
};
export default App;
